function yellowGrayInput(event)
{
    if(event.key=="Enter") 
    {
        let next_sibling = $(this).nextAll(".input1").eq(0);
        if(next_sibling.length!==0) 
            next_sibling.focus();
        else
             $("#g0").focus();
    }
    else
    {
        alphabet = "ABCÇDEFGĞHIİJKLMNOÖPRSŞTUÜVYZabcçdefgğhıijklmnoöprsştuüvyz";
        if(alphabet.indexOf(event.key)!==-1) 
            this.value = this.value +  turkish_letters_map[event.key];
        event.preventDefault();
    }
}

function greeenLetterInput(event)
{
    alphabet = "ABCÇDEFGĞHIİJKLMNOÖPRSŞTUÜVYZabcçdefgğhıijklmnoöprsştuüvyz";
    if(alphabet.indexOf(event.key)===-1) 
    {
        event.preventDefault();
        this.value='';
        return;
    }
    else
        this.value = turkish_letters_map[event.key];

    if(this.nextElementSibling==null) 
        this.blur();
    else
        this.nextElementSibling.focus();

    event.preventDefault();
}

function greenLetterClick(event)
{
    this.value = '';
}

